import React from 'react';

export default function Welcome() {
  return (
    <section className="section auth">
      <div className="container">
        <h1>Bienvenido!</h1>
        <p>Se ha registrado exitosamente</p>
        <p>Te hemos enviado un correo electronico de verificacion. Por favor has click en el link de verificacion para confirmar tu cuenta.</p>
      </div>
    </section>
  )
}
